import React from "react";

const TechForward = () => {
  return (
    <>
      {/* Command Centre */}
      <section className="py-4 md:py-10 xxl:pt-32">
        <div className="container xxl:max-larger:max-w-[1220px]">
          <h2 className="text-center font-SangBleuKingdomTrial max-[300px]:text-[16pt] text-sm md:text-xl font-medium text-fadeGreen leading-normal capitalize">
            Command Centre
          </h2>

          <div class="border-2 border-lightGray px-2 md:px-4 xl:px-6 py-2 mt-4 lg:mt-24">
            <div>
                <img src="/" alt="" />
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default TechForward;
